import React from "react";

import Artista from "../paginas/Artista";

export default class ListaArtistas extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <>
                {this.props.map((artista) => {
                    <Artista nombre={artista.nombre} />
                })}
            </>
        )
    }
}
